import { makeAutoObservable } from "mobx";

export default class ServiceState {
  constructor() {
    this._types = [
      { id: 1, name: "dkjn" },
      { id: 2, name: "sfs" },
    ];
    this._services = [
      {
        id: 1,
        title: "d,njkdkjfn",
        description: "ewlfknkle",
        price: 32,
        rating: 5,
      },
      {
        id: 2,
        title: "d,njkdkjfn",
        description: "ewlfknkle",
        price: 32,
        rating: 5,
      },
      {
        id: 3,
        title: "d,njkdkjfn",
        description: "ewlfknkle",
        price: 32,
        rating: 5,
      },
      {
        id: 4,
        title: "d,njkdkjfn",
        description: "ewlfknkle",
        price: 32,
        rating: 5,
      },
    ];
    makeAutoObservable(this);
  }

  setTypes(types) {
    this._types = types;
  }

  setServices(services) {
    this._services = services;
  }

  get types() {
    return this._types;
  }

  get services() {
    return this._services;
  }
}
